/**
 * Payment Checkout Screen for MediMindPlus
 * Handles Stripe payment processing for consultations
 */

import React, { useState } from 'react';
import {
  View,
  Text,
  StyleSheet,
  TouchableOpacity,
  ActivityIndicator,
  Alert,
  ScrollView,
} from 'react-native';
import { useSelector, useDispatch } from 'react-redux';
import { StripeProvider, useStripe } from '@stripe/stripe-react-native';
import { Ionicons } from '@expo/vector-icons';
import { RootState, AppDispatch } from '../store/store';
import { confirmPayment } from '../store/slices/paymentSlice';
import { paymentAPI } from '../services/paymentAPI';

interface RouteParams {
  consultationId: string;
  paymentIntent: {
    clientSecret: string;
    paymentIntentId: string;
    amount: number;
  };
}

interface Props {
  route: { params: RouteParams };
  navigation: any;
}

const PaymentCheckoutContent: React.FC<Props> = ({ route, navigation }) => {
  const dispatch = useDispatch<AppDispatch>();
  const { presentPaymentSheet, initPaymentSheet } = useStripe();
  const { consultationId, paymentIntent } = route.params;

  const [loading, setLoading] = useState(false);
  const [paymentSheetInitialized, setPaymentSheetInitialized] = useState(false);

  const amount = paymentIntent.amount / 100; // Convert cents to dollars

  const initializePaymentSheet = async () => {
    try {
      setLoading(true);

      const { error } = await initPaymentSheet({
        paymentIntentClientSecret: paymentIntent.clientSecret,
        merchantDisplayName: 'MediMindPlus',
        appearance: {
          colors: {
            primary: '#007AFF',
            background: '#FFFFFF',
            componentBackground: '#F5F5F5',
          },
        },
        returnURL: 'medimindplus://payment-return',
      });

      if (error) {
        console.error('Error initializing payment sheet:', error);
        Alert.alert('Error', error.message || 'Failed to initialize payment');
        return false;
      }

      setPaymentSheetInitialized(true);
      return true;
    } catch (error: any) {
      console.error('Exception initializing payment sheet:', error);
      Alert.alert('Error', 'Failed to initialize payment');
      return false;
    } finally {
      setLoading(false);
    }
  };

  const handlePayment = async () => {
    try {
      // Initialize payment sheet if not already done
      if (!paymentSheetInitialized) {
        const initialized = await initializePaymentSheet();
        if (!initialized) return;
      }

      setLoading(true);

      // Present payment sheet
      const { error } = await presentPaymentSheet();

      if (error) {
        if (error.code === 'Canceled') {
          // User cancelled the payment sheet
          return;
        }
        throw new Error(error.message || 'Payment failed');
      }

      // Payment successful, confirm with backend
      await dispatch(
        confirmPayment({
          consultationId,
          paymentIntentId: paymentIntent.paymentIntentId,
        })
      ).unwrap();

      // Show success message
      Alert.alert(
        'Payment Successful',
        'Your consultation has been confirmed!',
        [
          {
            text: 'OK',
            onPress: () => {
              navigation.reset({
                index: 0,
                routes: [
                  { name: 'Home' },
                  {
                    name: 'PaymentSuccess',
                    params: { consultationId },
                  },
                ],
              });
            },
          },
        ]
      );
    } catch (error: any) {
      console.error('Payment error:', error);
      Alert.alert(
        'Payment Failed',
        error.message || 'Unable to process payment. Please try again.'
      );
    } finally {
      setLoading(false);
    }
  };

  const handleCancel = () => {
    Alert.alert(
      'Cancel Payment',
      'Are you sure you want to cancel? Your booking will not be confirmed.',
      [
        { text: 'No', style: 'cancel' },
        {
          text: 'Yes',
          style: 'destructive',
          onPress: () => navigation.goBack(),
        },
      ]
    );
  };

  return (
    <ScrollView style={styles.container} contentContainerStyle={styles.content}>
      {/* Header */}
      <View style={styles.header}>
        <Ionicons name="card-outline" size={64} color="#007AFF" />
        <Text style={styles.title}>Complete Payment</Text>
        <Text style={styles.subtitle}>
          Secure payment powered by Stripe
        </Text>
      </View>

      {/* Amount Card */}
      <View style={styles.card}>
        <Text style={styles.cardTitle}>Payment Amount</Text>
        <View style={styles.amountContainer}>
          <Text style={styles.currency}>$</Text>
          <Text style={styles.amount}>{amount.toFixed(2)}</Text>
        </View>
        <Text style={styles.amountDescription}>
          This is the total consultation fee
        </Text>
      </View>

      {/* Security Info */}
      <View style={styles.securityCard}>
        <View style={styles.securityRow}>
          <Ionicons name="shield-checkmark" size={24} color="#34C759" />
          <View style={styles.securityContent}>
            <Text style={styles.securityTitle}>Secure Payment</Text>
            <Text style={styles.securityText}>
              Your payment information is encrypted and secure
            </Text>
          </View>
        </View>

        <View style={styles.securityRow}>
          <Ionicons name="lock-closed" size={24} color="#34C759" />
          <View style={styles.securityContent}>
            <Text style={styles.securityTitle}>PCI Compliant</Text>
            <Text style={styles.securityText}>
              Stripe ensures PCI DSS compliance
            </Text>
          </View>
        </View>

        <View style={styles.securityRow}>
          <Ionicons name="card" size={24} color="#34C759" />
          <View style={styles.securityContent}>
            <Text style={styles.securityTitle}>Multiple Payment Methods</Text>
            <Text style={styles.securityText}>
              Credit cards, debit cards, and more
            </Text>
          </View>
        </View>
      </View>

      {/* Test Card Info (only in dev mode) */}
      {__DEV__ && (
        <View style={styles.testCard}>
          <Text style={styles.testCardTitle}>Test Card Information</Text>
          <Text style={styles.testCardText}>Card: 4242 4242 4242 4242</Text>
          <Text style={styles.testCardText}>Expiry: Any future date</Text>
          <Text style={styles.testCardText}>CVV: Any 3 digits</Text>
        </View>
      )}

      {/* Action Buttons */}
      <View style={styles.actionContainer}>
        <TouchableOpacity
          style={[styles.primaryButton, loading && styles.buttonDisabled]}
          onPress={handlePayment}
          disabled={loading}
        >
          {loading ? (
            <ActivityIndicator color="#FFFFFF" />
          ) : (
            <>
              <Ionicons name="lock-closed" size={20} color="#FFFFFF" />
              <Text style={styles.primaryButtonText}>Pay ${amount.toFixed(2)}</Text>
            </>
          )}
        </TouchableOpacity>

        <TouchableOpacity
          style={styles.secondaryButton}
          onPress={handleCancel}
          disabled={loading}
        >
          <Text style={styles.secondaryButtonText}>Cancel</Text>
        </TouchableOpacity>
      </View>

      {/* Terms */}
      <View style={styles.termsContainer}>
        <Text style={styles.termsText}>
          By completing this payment, you agree to our{' '}
          <Text style={styles.termsLink}>Terms of Service</Text> and{' '}
          <Text style={styles.termsLink}>Refund Policy</Text>.
        </Text>
      </View>
    </ScrollView>
  );
};

const PaymentCheckoutScreen: React.FC<Props> = (props) => {
  const publishableKey = paymentAPI.getStripePublishableKey();

  return (
    <StripeProvider publishableKey={publishableKey}>
      <PaymentCheckoutContent {...props} />
    </StripeProvider>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#F5F5F5',
  },
  content: {
    padding: 20,
  },
  header: {
    alignItems: 'center',
    marginBottom: 32,
  },
  title: {
    fontSize: 28,
    fontWeight: 'bold',
    color: '#000',
    marginTop: 16,
  },
  subtitle: {
    fontSize: 16,
    color: '#666',
    marginTop: 8,
  },
  card: {
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    padding: 24,
    marginBottom: 16,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
    alignItems: 'center',
  },
  cardTitle: {
    fontSize: 16,
    color: '#666',
    marginBottom: 16,
  },
  amountContainer: {
    flexDirection: 'row',
    alignItems: 'baseline',
    marginBottom: 8,
  },
  currency: {
    fontSize: 32,
    fontWeight: 'bold',
    color: '#007AFF',
  },
  amount: {
    fontSize: 48,
    fontWeight: 'bold',
    color: '#007AFF',
  },
  amountDescription: {
    fontSize: 14,
    color: '#999',
  },
  securityCard: {
    backgroundColor: '#FFFFFF',
    borderRadius: 12,
    padding: 20,
    marginBottom: 16,
  },
  securityRow: {
    flexDirection: 'row',
    alignItems: 'flex-start',
    marginBottom: 16,
  },
  securityContent: {
    flex: 1,
    marginLeft: 12,
  },
  securityTitle: {
    fontSize: 16,
    fontWeight: '600',
    color: '#000',
    marginBottom: 4,
  },
  securityText: {
    fontSize: 14,
    color: '#666',
    lineHeight: 20,
  },
  testCard: {
    backgroundColor: '#FFF9E6',
    borderRadius: 12,
    padding: 16,
    marginBottom: 16,
    borderLeftWidth: 4,
    borderLeftColor: '#FFB800',
  },
  testCardTitle: {
    fontSize: 16,
    fontWeight: '600',
    color: '#000',
    marginBottom: 8,
  },
  testCardText: {
    fontSize: 14,
    color: '#666',
    marginBottom: 4,
    fontFamily: 'monospace',
  },
  actionContainer: {
    marginTop: 8,
    marginBottom: 16,
  },
  primaryButton: {
    backgroundColor: '#007AFF',
    paddingVertical: 16,
    borderRadius: 12,
    flexDirection: 'row',
    justifyContent: 'center',
    alignItems: 'center',
    marginBottom: 12,
  },
  primaryButtonText: {
    color: '#FFFFFF',
    fontSize: 18,
    fontWeight: 'bold',
    marginLeft: 8,
  },
  buttonDisabled: {
    opacity: 0.6,
  },
  secondaryButton: {
    paddingVertical: 16,
    borderRadius: 12,
    borderWidth: 1,
    borderColor: '#007AFF',
    justifyContent: 'center',
    alignItems: 'center',
  },
  secondaryButtonText: {
    color: '#007AFF',
    fontSize: 16,
    fontWeight: '600',
  },
  termsContainer: {
    paddingHorizontal: 20,
    marginBottom: 20,
  },
  termsText: {
    fontSize: 12,
    color: '#999',
    textAlign: 'center',
    lineHeight: 18,
  },
  termsLink: {
    color: '#007AFF',
    textDecorationLine: 'underline',
  },
});

export default PaymentCheckoutScreen;
